let accessToken = localStorage.getItem("token");

export const setAccessToken = (s: string) => {
  accessToken = s;
};

export const removeAccessToken = () => {
  localStorage.removeItem("token");
  accessToken = "";
};

export const getAccessToken = () => {
  return accessToken;
};
